import {BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Deshboard_AD from "./pages/admin/adminDeshboard";
import ScrollToTop from './components/comman/ScrollHandle';
import Deshboard_DR from './pages/doctor/doctorDeshboard';

function App() {
  return (
    <div>
      <Router>
        <ScrollToTop></ScrollToTop>
        <Routes>
          <Route path='admin' element={<Deshboard_AD></Deshboard_AD>}/>
          <Route path='doctor' element={<Deshboard_DR></Deshboard_DR>} />
          <Route path='doctor' element={<Deshboard_DR></Deshboard_DR>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
